import React from 'react';
import App from 'next/app';
import { DefaultSeo } from 'next-seo';

export default class MyApp extends App {
    render() {
        const { Component, pageProps } = this.props
        return (
            <React.Fragment>
                <DefaultSeo
                    title="Thortech Asia Software"
                    description="Perusahaan Software di Samarinda"
                    openGraph={{
                        type: 'website',
                        locale: 'id-ID',
                        url: 'https://thortech.asia',
                        site_name: 'Thortech Asia Software',
                    }}
                />
                <Component {...pageProps} />
            </React.Fragment>
        );
    }
}
